import styled from "styled-components"

const Header = styled.div`
    color:white;
    font-size:1.2em;
    width:100%;
    background-color:#448487;
    padding:10px 0;
    position:fixed;
    display:flex;
    .logo-container{
        display:flex;
        justify-content:center;
        align-items:center;
    }
    .navigation{
        display:flex;
        justify-content:flex-end;
        align-items:center;
    }

`
export default Header
